<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="UTF-8" />
    <meta name="viewport" content="width=device-width, initial-scale=1.0" />
    <title>苹果旗舰店</title>
    <style>
      * {
        margin: 0;
        padding: 0;
      }
      body {
        width: 100%;
        /* overflow: hidden; */
      }
      img {
        width: 100%;
      }
      /* 首页面 */
      .container {
        width: 100%;
        position: relative;
      }
      .box-one {
        width: 100%;
        position: relative;
      }
      .bottom-one {
        position: absolute;
        bottom: 5%;
        right: 2%;
        width: 134px;
        height: 42px;
        /* background-color: rgba(0,0,0,0.5); */
      }
      /* 购买页面 */
      .box-two {
        display: none;
        width: 100%;
        position: absolute;
        top: 0%;
      }
      .input {
        height: 33px;
        width: 90%;
        position: absolute;
        top: 58%;
        left: 50%;
        transform: translateX(-50%);
      }
      .input input[type="text"] {
        font-size: 17px;
        text-indent: 10px;
        width: 100%;
        height: 33px;
        background-color: #f3f3f3;
        outline: none;
        border: none;
      }

      .bottom-two {
        width: 100%;
        height: 44px;
        /* background-color: rgba(0, 0, 0, 0.5); */
        position: absolute;
        bottom: 36px;
      }

      /* 确认订单 */
      .box-three {
        display: none;
        width: 100%;
        position: absolute;
        top: 0;
      }
      .bottom-three {
        width: 121px;
        height: 49px;
        /* background-color: rgba(0, 0, 0, 0.5); */
        position: absolute;
        bottom: 5%;
        left: 70%;
      }
      .video {
        display: none;
        width: 150px;
        height: 150px;
        position: absolute;
        top: 50%;
        left: 50%;
        transform: translate(-50%, -50%);
      }
      video {
        width: 150px;
        height: 150px;
      }
      /* 支付成功 */
      .box-four {
        display: none;
        width: 100%;
        position: absolute;
        top: 0;
      }
      .bottom-four {
        width: 69px;
        height: 49px;
        /* background-color: rgba(0, 0, 0, 0.5); */
        position: absolute;
        top: 7%;
        left: -5px;
      }

      a {
        display: block;
        width: 100%;
        height: 100%;
      }
    </style>
  </head>
